const Styles = styled.div`
    .jumbotron {
        background: url(${jumbocode}) no-repeat fixed;
        background-size: cover;
        color: white;
        height: 420px;
        position: relative;
        padding-top: 4px;
    }
`;

export const Jumbotron = () => (
    <Styles>
        <Jumbo fluid className="jumbo">
            <div className="overlay"></div>
            <Container>
            </Container>
        </Jumbo>
    </Styles>
)
